    "use strict";

    __webpack_require__.r(__webpack_exports__);
    /* harmony default export */


    __webpack_exports__["default"] = "<section id=\"faqs\" class=\"faq-area ptb-100\">\n    <div class=\"container\">\n        <div class=\"section-title\">\n            <span>FAQ</span>\n            <h2>Frequently Asked <b>Question</b></h2>\n        </div>\n        <div class=\"tab-slider-nav\">\n            <ul class=\"tab-slider-tabs\">\n                <li class=\"tab-slider-trigger active\" rel=\"account\">ACCOUNT REGISTRATION</li>\n                <li class=\"tab-slider-trigger\" rel=\"incentive\">INCENTIVIZATION</li>\n                <li class=\"tab-slider-trigger\" rel=\"survey\">SURVEY PARTICIPATION</li>\n                <li class=\"tab-slider-trigger\" rel=\"profile\">PROFILE/ACCOUNT MANAGEMENT</li>\n            </ul>\n        </div>\n\n            <div class=\"tab-slider-container\">\n                <div id=\"account\" class=\"tab-slider-body\">\n                    <div class=\"row\">\n                        <div class=\"col-lg-6 col-md-12\">\n                            <div class=\"faq-accordion\" id=\"accordionEx\" role=\"tablist\" aria-multiselectable=\"true\">\n                                <div class=\"card\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingOne\">\n                                        <a data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseOne\" aria-expanded=\"false\" aria-controls=\"collapseOne\">\n                                            How do I register? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseOne\" class=\"collapse show\" role=\"tabpanel\" aria-labelledby=\"headingOne\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            • Our registration is extremely easy and fast. Once you in put your details, accept the terms and conditions after which you click on sign up to submit your details.\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingTwo\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\n                                            How do I verify my Account? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseTwo\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwo\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tYou will receive an email immediately after clicking sign up. This email notifies you that you are now a registered member of Reinit Research. All you need to do is to click on the link provided within the mail. This is an account verification process that validates your details and proves you are the sole owner of your account.\n                                            <br/>\n                                            •\tSometimes this email ends up in the spam / unknown folder of your email programme so always check.\n                                            <br/>\n                                            •\tRemember only verified accounts are awarded after our surveys.\n                                            <br/>\n                                            •\tA username and password are provided for you within this same mail. Use these details to log in to your account and get started.\n                                            <br/>\n                                            •\tYou will be awarded between 50-200 points for every survey you complete successfully. The amount of points awarded can vary among surveys. We will always tell you how much you will get, before you take part in the surveys.\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingThree\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseThree\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\n                                            Can I have multiple accounts? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseThree\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tNo, this against our terms and conditions, in the event that a user has multiple accounts, both will be deleted from our database.\n                                        </div>\n                                    </div>\n                                </div>\n                            </div>\n                        </div>\n                        <div class=\"col-lg-6 col-md-12\">\n                            <div class=\"faq-image\">\n                                <img src=\"assets/img/faq-bg.jpg\" alt=\"img\">\n                            </div>\n                        </div>\n                    </div>\n                </div>\n                <div id=\"incentive\" class=\"tab-slider-body\">\n                    <div class=\"row\">\n                        <div class=\"col-lg-6 col-md-12\">\n                            <div class=\"faq-accordion\" id=\"accordionEx\" role=\"tablist\" aria-multiselectable=\"true\">\n                                <div class=\"card\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFour\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFour\" aria-expanded=\"false\" aria-controls=\"collapseFour\">\n                                            How are Points Awarded? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFour\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFour\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tPoints are awarded for only a complete survey and after we run data verification to check the quality of responses provided.\n                                            <br/>\n                                            •\tPlease note that this might take time and sometimes we have to wait until the whole survey is closed to facilitate this.\n                                            <br/>\n                                            •\tWe encourage that the responses provided are honest and open to avoid denial of points as a result of bad data.\n                                            <br/>\n                                            •\tThe amount of points awarded can vary among surveys. We will always tell you how much you will get, before you take part in the surveys.\n                                            <br/>\n                                            •\tParticipation is always voluntary and consensual.\n\n                                            Points are not awarded for the below scenarios:\n\n                                            •\tScreen outs- Surveys have a respondent qualification criterion of which is normally determined by the first few questions you respond to. If you are disqualified at this stage, you will not be awarded. We however will try as much as possible to send to you surveys that we feel you qualify for to avoid these cases.\n                                            <br/>\n                                            •\tStraight lining- When your responses are predictable to a point that we can tell you are not reading the questions properly; you will not be awarded even if you get to the end of the survey. Your interview will be terminated and you will be informed as this undermines data quality. In the long run if this is repeated, you will be expelled from our panel for good.\n                                            <br/>\n                                            •\tSpeeding- Points are not awarded for respondents who speed through a survey. We encourage you to take your time and read through the questions to get a proper understanding so as to provide the required responses. Like straight-lining, the interview is deleted even if you get to the end and you will receive a warning. If this persists you are expelled from the panel as well.\n                                            <br/>\n                                            •\tDouble participation- You can only participate once in a survey, attempts to participate multiple times will lead to an automatic disqualification.\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            How do I Redeem my points? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tThe minimum redeemable points are 100. You can always redeem at your discretion after hitting the threshold and this will be sent to you in form of airtime within 12 hours of initiating the process.<br/>\n                                            •\tLog into your account and click on the redeem points burton to initiate the process. Enter the number of points you want to redeem and submit. We will take it from this point<br/>\n                                            •\tRemember 100 points= 1 USD.<br/>\n                                            •\tThe disbursements are sent via your dully registered phone number.<br/>\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            Why did I not get my points, despite completing the survey? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tIt can sometimes take up to several days for earned points to show in your account. This is because points are awarded after a study has been officially closed. Please bear with us as we undergo the process of awarding.\n                                             <br/>\n                                            •\tFeel free to send us an email or chat with us, if you still haven’t received any earned points after 7 days.\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            Are there any other ways to earn points? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tApart from the surveys that you are invited to, you can also take part in the surveys posted on our website.\n                                             <br/>\n                                            •\tYou can also earn bonus points by inviting your friends to our panel.\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            Are there any other ways to earn points? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tApart from the surveys that you are invited to, you can also take part in the surveys posted on our website.\n                                             <br/>\n                                            •\tYou can also earn bonus points by inviting your friends to our panel.\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            Why did I not get any payment after inviting my friends? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tAlways make sure that the friend you referred to us activates their account just like you did upon signing up by clicking on the link in the email they receive. Otherwise, our system will unfortunately not be able to identify who has recruited the participant.\n                                        </div>\n                                    </div>\n                                </div>\n                            </div>\n                        </div>\n                        <div class=\"col-lg-6 col-md-12\">\n                            <div class=\"faq-image\">\n                                <img src=\"assets/img/faq-bg.jpg\" alt=\"img\">\n                            </div>\n                        </div>\n                    </div>\n                </div>\n                <div id=\"survey\" class=\"tab-slider-body\">\n                    <div class=\"row\">\n                        <div class=\"col-lg-6 col-md-12\">\n                            <div class=\"faq-accordion\" id=\"accordionEx\" role=\"tablist\" aria-multiselectable=\"true\">\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            How will I be invited to participate in your Surveys? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tIn order to take part in our online-surveys and be awarded, kindly register on our website https//www.YYYYYY.com\n                                            <br/>\n                                            •\tWe will invite you to participate in our surveys from time to time depending on the respondent qualification criteria. Remember survey participation is at your own will and we will be hoping to get your opinions on as many surveys as you qualify for while at the same time keeping in mind the standard number of invites, we can share with you.\n                                            <br/>\n                                            •\tOur invites will mostly be done via the email you sign up with. At times we will invite you to participate in our surveys via SMS or a call.\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            Survey participation periods? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tSurvey have a time frame to which new would like to gather your responses. As a result, surveys will only be open during this period after which they are de-activated.\n                                            <br/>\n                                            •\tWe sometimes will send you reminders to inform you about the time remaining for your participation.\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            What types of surveys will I be participating in? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tWe will have a wide range of topics ranging from different products and services, to your opinions about certain adverts, travel preferences etc.\n                                            <br/>\n                                            •\tCompanies will use the results, for example, to develop new products or to adapt to the needs of consumers such as yourself.\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            How often will I be invited to online-surveys? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tAs mentioned earlier, we will only invite you for surveys you qualify for when they are available, therefore we cannot tell how many invitations you will receive.\n                                            <br/>\n                                            •\tThe number of invitations depends greatly on the country that you live in - surveys are conducted more frequently in some countries than in others.\n                                            <br/>\n                                            •\tParticipants are also selected randomly, or there may be a pre-selection depending on age, gender, level of education, profession, place of residence, etc. This depends on the target group requirements set by our clients.\n                                            <br/>\n                                            •\tUpdating your profile frequently will allow us to have a better segmentation of our database thus we can easily select you for surveys you will qualify.\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            How do I make sure that your invites do not end up in my spam box? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tIf our survey invitations end up in your spam folder, you can adjust your mail settings by adding our mail address to your address book.\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            What happens with my data and my responses to the surveys I participate in? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tThe details you provided when registering and when updating your profile are used for the sole purpose of selecting participants for surveys.\n                                            <br/>\n                                            •\tResponses from surveys cannot be traced back to you as an individual. All data is pooled for analysis.\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            How come I am getting none or very few invitations to surveys? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tSurveys require specific criteria of members, over and above country of residence. Therefore, if you meet this criterion be sure we will invite you.\n                                            <br/>\n                                            •\tIf you don’t rest assured there will be other surveys in the near future in which you can still participate.\n                                            <br/>\n                                            •\tWe recommend that you fully complete your profile and to always keep your details up to date. This will allow us to ensure that you are invited to surveys more selectively.\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            Why is the invitation link to the survey not working? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            The following tips may help with future surveys.\n                                            <br/>\n                                            •\tDeactivate your pop-up blocker\n                                            <br/>\n                                            •\tUse Chrome or Firefox as a browser\n                                            <br/>\n                                            •\tAvoid double-clicking the link\n                                            <br/>\n                                            •\tIn case of doubt, copy the link to your browser before clicking the “take part” link\n                                            <br/>\n                                            •\tAlways use the intended device\n                                            <br/>\n                                            •\tPlease note that every link can be clicked only once. As soon as you have clicked a link, the survey is considered to be started and it cannot be opened/re-started after the browser window is closed.\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            Why am I told that I do not qualify for the survey?  <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tSpecific questions are used to determine whether a participant matches the target group.\n                                            <br/>\n                                            •\tThe survey is terminated early on, if you don’t match the target group\n\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            Why am I being told that the required number of participants has already been reached, shortly after starting the survey? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tOnce the number of responses we intended to get is attained, we always close the survey thus trying to access the survey will prompt this message.\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            How can I re-start the survey or continue it after an interruption? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tEach survey link can be clicked only once. For this reason it is, unfortunately, not possible to take a break during the survey or to re-start it after closing the browser window.\n                                            <br/>\n                                            •\tIn the case of prolonged inactivity, there may be short interruptions of the internet connection leading to the survey being aborted.\n                                            <br/>\n                                            •\tFor security reasons and due to international market research guidelines, a survey cannot be continued and the results cannot be included in the analysis.\n\n                                        </div>\n                                    </div>\n                                </div>\n                            </div>\n                        </div>\n                        <div class=\"col-lg-6 col-md-12\">\n                            <div class=\"faq-image\">\n                                <img src=\"assets/img/faq-bg.jpg\" alt=\"img\">\n                            </div>\n                        </div>\n                    </div>\n                </div>\n                <div id=\"profile\" class=\"tab-slider-body\">\n                    <div class=\"row\">\n                        <div class=\"col-lg-6 col-md-12\">\n                            <div class=\"faq-accordion\" id=\"accordionEx\" role=\"tablist\" aria-multiselectable=\"true\">\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            How do I reset my password?  <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            Kindly proceed as follows:\n                                            <br/>\n                                            •\tGo to the login page\n                                            <br/>\n                                            •\tClick “forgot my password” underneath the login area\n                                            <br/>\n                                            •\tNow type in the email address you used for registering with the survey portal\n                                            <br/>\n                                            •\tWe will immediately send you an email containing a link for resetting your password\n                                            <br/>\n                                            •\tCheck your inbox\n                                            <br/>\n                                            •\tClick the link in the email\n                                            <br/>\n                                            •\tSet a new password\n\n                                        </div>\n                                    </div>\n\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            How do I update my profile? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tYou can update your profile by logging into your account using your email address and password. Go to “My profile” to change your details.\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            How do I change my email address? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tFor security reasons, you are not able to change your own email address. Please send us a short message containing your old and your new email address.\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            How can I delete my profile? <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tYou can do so directly in your profile area. You will need to log in and click “Delete account”. We will then receive the request and approve the account deletion within 24 hours.\n                                        </div>\n                                    </div>\n                                </div>\n                                <div class=\"card mb-0\">\n                                    <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordionEx\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n                                            I have a different question <i class=\"icofont-dotted-down\"></i>\n                                        </a>\n                                    </div>\n                                    <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordionEx\">\n                                        <div class=\"card-body\">\n                                            •\tPlease write to us through feedback@reinitresearch.com\n                                        </div>\n                                    </div>\n                                </div>\n                            </div>\n                        </div>\n                        <div class=\"col-lg-6 col-md-12\">\n                            <div class=\"faq-image\">\n                                <img src=\"assets/img/faq-bg.jpg\" alt=\"img\">\n                            </div>\n                        </div>\n                    </div>\n                </div>\n            </div>\n\n    </div>\n</section>\n";
