    __webpack_exports__["default"] = "<section id=\"work\" class=\"why-we-different ptb-100 bg-image\">\n    <div class=\"container\">\n        <div class=\"section-title\">\n            <span>What We Do</span>\n            <h2>Our <b>Services</b></h2>\n        </div>\n        <div class=\"tab\">\n            <ul class=\"tabs\">\n                <li><a href=\"#\">\n                    Market Research\n                </a></li>\n                <li><a href=\"#\">\n                    Social Research\n                </a></li>\n                <li><a href=\"#\">\n                    Data Collection\n                </a></li>\n                <li><a href=\"#\">\n                    Data Analisis\n                </a></li>\n            </ul>\n            <div class=\"tab_content\">\n                <div class=\"tabs_item\">\n                    <div class=\"row\">\n                        <div class=\"col-lg-12\">\n                            <p>\n                                Reinit Research connects you with one of the largest consumer audience in Africa.\n                                We deliver quality, unbiased, market research data tailored to the needs of your business with our unique combination of expertise and reach.\n                                Our years of experience in building sampling plans and executing online research studies makes us your preferred one-stop sample provider!\n                           </p>\n                        </div>\n                    </div><br/>\n                    <div class=\"row align-items-center\">\n                        <div class=\"col-lg-6 col-md-12 why-we-different-content\">\n                            <div class=\"tabs_item_content\">\n                               <h3>Quantitative Market Research</h3>\n\n                               <p>\n                                We empower our clients with information that helps them make important decisions by identifying factors that drive customer loyalty, understanding relationships/engagements and all forms of ad-hoc research into brands, products and services through:\n                                <br/>\n                                •\tComputer Aided Web Interviews (CAWI)<br/>\n                                •\tComputer Aided Telephonic Interviews (CATI)<br/>\n                                •\tFace to Face Interviews (F2F)<br/>\n                                •\tComputer Aided Personal Interviews (CAPI)<br/>\n                                •\tMall Intercepts<br/>\n                                •\tDiary Studies<br/>\n                                •\tTrackers Studies<br/>\n\n                               </p><br/>\n\n                               <h3>Quantitative Market Research</h3>\n\n                               <p>\n                                We have a wide range of qualitative services which comprises of: <br/>\n                                •\tFocus Group Discussions<br/>\n                                •\tIn-Depth Interviews<br/>\n                                •\tKey Informant Interviews<br/>\n                                •\tOnline Focus Group Discussions<br/>\n                                •\tEthnographic Approaches<br/>\n                                •\tMystery Shopping<br/>\n\n                               </p>\n                            </div>\n                        </div>\n                        <div class=\"col-lg-6 col-md-12 why-we-different-img\">\n                            <div class=\"tabs_item_content\">\n                                <h3>Our Data collection Methods</h3>\n                                <p>\n                                    Our methodological recommendations are based on your research needs and the questions at hand, rather than our own product portfolio.\n                                    <br/>\n                                    1.\tOnline data collection via our proprietary panel\n                                    We are trend setters in Africa, connecting you to over 300,000 consumers while helping you get in touch with them directly through online research. We profile our panelists using detailed background information therefore giving you a wide array of options to choose from according to your needs. We deliver quality, unbiased, market research data tailored to the needs of your business with our unique combination of expertise and reach.\n                                    We are a corporate member of ESOMAR and as such have fully complied with the set standards for online research. Our panel recruitment registration is done on a strict double-opt-in (DOI) basis. All potential panelists registering with us automatically receive an email with a link to confirmation registration. Only upon this confirmation, is the registration complete.\n                                    We also have implemented advanced quality control procedures to eliminate fraudulent panelists. One such measure is to ensure that our clients receive real-time fieldwork reports through online portals.\n                                    <br/>\n                                    2.\tPersonal interviews\n                                    Thanks to our knowledgeable and experienced team of more than 500 interviewers spread across Africa, we meet your expectations and deliver the highest quality standards in research. We conduct our interviews on the streets, in the shopping centers, at home and the work places of the respondent or in one of our dedicated test facilities.\n\n                                </p>\n                            </div>\n                        </div>\n                    </div>\n                    <div class=\"col-lg-12\">\n                        <h3>Our coverage</h3>\n                        <p>\n                            We can conduct research studies in following countries:<br/>\n                            •\tKenya\t•\tTanzania\t•\tSouth Africa\t•\tRwanda\n                            •\tNigeria\t•\tUganda\t•\tGhana\t•\tBurundi\n\n                       </p>\n                    </div>\n                    <div class=\"col-lg-12\">\n                        <h3>Sectors we cover</h3>\n                        <p>\n                            •\tTelecommunication\t•\tEntertainment & Leisure\t•\tMom with Kids\n                            •\tMedia\t•\tTobacco\t•\tEducation\n                            •\tFinancial/ Insurance \t•\tAirline/ Transport\t•\tAlcoholic Beverages\n                            •\tFood & Beverages\t•\tTravel & Tourism\t•\tRetail\n                            •\tPharmaceuticals & Health\t•\tAutomotive\t•\tIT\n                            •\tBeauty & Style\t•\tAgriculture\t•\tSports & Culture\n                            •\tOnline Panel Management\t•\tGovernment Sector\n\n                       </p>\n                    </div>\n                </div>\n                <div class=\"tabs_item\">\n                    <div class=\"row align-items-center\">\n                        <div class=\"row\">\n                            <div class=\"col-lg-12\">\n                                <p>\n                                    At Reinit Research, we work alongside policy-makers and program implementers to design,\n                                    evaluate and report based on the evidence we gather from research,\n                                    monitoring and evaluation.\n                               </p>\n                            </div>\n                        </div><br/>\n                        <div class=\"col-lg-6 col-md-12 why-we-different-img\">\n                            <div class=\"tabs_item_content\">\n                                <h3>Baseline Assessments </h3>\n                                <p>\n                                    Baseline surveys also known as Formative assessments provide quantitative and qualitative information on\n                                    the current status of a particular situation in a given population. Baseline assessments aim at quantifying\n                                    the distribution of certain variables in a study population at one point in time therefore benchmark the project indicators.\n                                </p><br/>\n                                <h3>Baseline Assessments </h3>\n                                <p>\n                                    This is also commonly referred to as the mid-term reviews.\n                                    At Reinit Research, we endeavor to establish whether a project is heading towards the set goals and objectives,\n                                    thereafter informing management and control decisions by the project management.\n                                </p>\n                            </div>\n                        </div>\n                        <div class=\"col-lg-6 col-md-12 why-we-different-content\">\n                            <div class=\"tabs_item_content\">\n                                <h3>End of Term Evaluations</h3>\n                                <p>\n                                    This evaluation type is also known as the Summative evaluation, Endline evaluation or the Project Completion evaluation.\n                                    At Reinit Research, we establish project outputs and immediate outcomes, with results of the evaluation compared to the\n                                    results at baseline and midline. We use the evaluation findings to inform implementors and stakeholders on the project success\n                                    and is important for documenting success stories and lessons learnt.\n                                </p><br/>\n\n                                <h3>Operational Research</h3>\n                                <p>\n                                    Operations Research is gaining importance in programmes globally.\n                                    At Reinit Research, we offer solutions that guide the programme implementation to achieve best\n                                    results by utilizing a vast range of qualitative and quantitative tools, to produce significant\n                                    results worth applying and testing in the real field. Through operations research,\n                                    we identify problems and test the feasible solutions for them.\n                                </p>\n\n                            </div>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"tabs_item\">\n                    <div class=\"row align-items-center\">\n                        <div class=\"col-lg-6 col-md-12 why-we-different-content\">\n                            <div class=\"tabs_item_content\">\n                                <p>\n                                    As times are changing so are we.\n                                    Reinit Research has adopted electronic data collection methods that enable online and offline data gathering.\n                                    Our electronic data collection and analysis capacities allow prompt trend analysis and triangulation while still in\n                                    the field. <br/>\n                                    Electronic data collection has the following advantages:\n                                </p>\n                                <ul>\n                                    <li>Its fast:\n                                        Use of electronic tools increases the speed of data processing since interviewers carry out multiple\n                                        tasks of interviewing, data entry and coding concurrently.\n                                    </li>\n                                    <li>\n                                        Its accurate:\n                                        No requirement for scrutiny or validation programmes since the electronic tool is programmed\n                                        to avoid multiple errors through preset skip patterns, avoiding missed questions,\n                                        use of GPS to take interview locations.\n                                    </li>\n                                    <li>It cuts cost: Use will cut in fieldwork and analysis time. </li>\n                                    <li>Quality: It also improves data quality!</li>\n                                </ul>\n                            </div>\n                        </div>\n                        <div class=\"col-lg-6 col-md-12 why-we-different-img\">\n                            <div class=\"tabs_item_img\">\n                                <img src=\"assets/img/data.jpg\" alt=\"img\">\n                            </div>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"tabs_item\">\n                    <div class=\"row align-items-center\">\n                        <div class=\"col-lg-6 col-md-12 why-we-different-img\">\n                            <div class=\"tabs_item_img\">\n                                <img src=\"assets/img/data.jpg\" alt=\"img\">\n                            </div>\n                        </div>\n                        <div class=\"col-lg-6 col-md-12 why-we-different-content\">\n                            <div class=\"tabs_item_content\">\n                                <h3>Data Analisis</h3>\n                                <p>\n                                    In a world characterized by rapidly changing information and split-second decisions,\n                                    businesses cannot fall behind in catering to the rigorous demands of data analysis processes and strategies.\n                                     To help organizations with the best possible data analysis, Reinit Research offers different customized data analysis services.\n                                     Regardless of how big or small your organisation is, minimizing risks and maximizing profit depend on how effectively you handle constantly flowing data.\n                                     Analyzing data routinely involves multiple challenges - accuracy, privacy, timing, security, and costs are five prime examples.\n                                     To overcome these challenges, Reinit Research data analysis specialists provide customized and comprehensive help to support better\n                                     decision-making at all levels for your organization.\n                                    With our data analysis experts, you get high-quality data analysis services that are reliable.\n                                </p>\n\n                            </div>\n                        </div>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>\n</section>\n";
